using AutoMapper;
using Microsoft.Extensions.Configuration;
using Moq;
using SCAPE.API.ActionsModels;
using SCAPE.API.Controllers;
using SCAPE.Application.DTOs;
using SCAPE.Application.Interfaces;
using SCAPE.Application.Services;
using SCAPE.Domain.Entities;
using SCAPE.Domain.Exceptions;
using SCAPE.Domain.Interfaces;
using SCAPE.Infraestructure.Context;
using SCAPE.Infraestructure.FaceRecognition;
using SCAPE.Infraestructure.Mappings;
using SCAPE.Infraestructure.Repositories;
using System.IO;
using System.Threading.Tasks;
using Xunit;

namespace SCAPE.UnitTests
{
    public class GetEmployeeByImageTest

    {
        private readonly IConfiguration _configuration;

      
        public GetEmployeeByImageTest()
        {
            _configuration = (IConfiguration)new ConfigurationBuilder().SetBasePath(Directory.GetCurrentDirectory()).AddJsonFile("appsettings.json").Build();
        }

        [Fact]
        public async Task imageReceivedContainFaceRegistered()
        {
            // Mocks
            var mock_Repository = new Mock<IEmployeeRepository>();

            // Preparation
            Employee employee = new Employee();
            employee.DocumentId = "1053";
            employee.FirstName = "Juan";
            employee.LastName = "Gomez";
            employee.Email = "gomez@gmail.com";
            employee.Sex = "M";
         

            // We make sure that you enter the persistenceId corresponding to the image.
            string persistedFaceId = "b3cfc2fa-c3b2-4187-a8f4-57b0e1b2c5c8";
            mock_Repository.Setup(m => m.findEmployeeByPersistedFaceId(It.IsAny<string>())).Returns(async () => employee);
            EmployeeService employeeServ = new EmployeeService(mock_Repository.Object,new FaceRecognition(_configuration));

            // Tests
            string faceListId = "prueba";
            string encodeImage = "";

            Employee employeeFound = await employeeServ.getEmployeeByFace(encodeImage, faceListId);

            Assert.Equal(employeeFound.DocumentId, employee.DocumentId);
        }
   
        [Fact]
        public async Task imageReceivedNotContainFace()
        {
            // Mocks
            var mock_Repository = new Mock<IEmployeeRepository>();
            
            // Tests
            EmployeeService employeeServ = new EmployeeService(mock_Repository.Object, new FaceRecognition(_configuration));
            string faceListId = "prueba";
            //Image without faces
            string encodeImage = "";

            FaceRecognitionException ex = await Assert.ThrowsAsync<FaceRecognitionException>(() => employeeServ.getEmployeeByFace(encodeImage, faceListId));
            Assert.Equal("The image must contain only one face",ex.Message);
        }

        [Fact]
        public async Task imageReceivedContainTwoFaces()
        {
            // Mocks
            var mock_Repository = new Mock<IEmployeeRepository>();

            // Tests
            EmployeeService employeeServ = new EmployeeService(mock_Repository.Object, new FaceRecognition(_configuration));
            string faceListId = "prueba";
            //Image with 2 faces
            string encodeImage = "";

            FaceRecognitionException ex = await Assert.ThrowsAsync<FaceRecognitionException>(() => employeeServ.getEmployeeByFace(encodeImage, faceListId));
            Assert.Equal("The image must contain only one face", ex.Message);
        }

        [Fact]
        public async Task imageReceivedNotBelongAnyEmployeeInDB()
        {
            // Mocks
            var mock_Repository = new Mock<IEmployeeRepository>();

            // We make sure that you enter the persistenceId corresponding to the image.
            string persistedFaceId = "fcf8ea75-8db3-46d5-84d2-a46e7c9606fc";
            mock_Repository.Setup(m => m.findEmployeeByPersistedFaceId(persistedFaceId)).Returns(async () => null);

            // Tests
            EmployeeService employeeServ = new EmployeeService(mock_Repository.Object, new FaceRecognition(_configuration));
            string faceListId = "prueba";

            //Image received does not belong to any employee of the Database (Image of Barack Obama)
            string encodeImage = "";

            EmployeeException ex = await Assert.ThrowsAsync<EmployeeException>(() => employeeServ.getEmployeeByFace(encodeImage, faceListId));
            Assert.Equal("No Employee found in Database for this persistedFaceId", ex.Message);
        }
       
        [Fact]
        public async Task imageReceivedNotBelongAnyEmployee()
        {
            // Mocks
            var mock_Repository = new Mock<IEmployeeRepository>();

            // Tests
            EmployeeService employeeServ = new EmployeeService(mock_Repository.Object, new FaceRecognition(_configuration));
            string faceListId = "prueba";

            //Image received does not belong to any employee of the faceList
            string encodeImage = "";

            FaceRecognitionException ex = await Assert.ThrowsAsync<FaceRecognitionException>(() => employeeServ.getEmployeeByFace(encodeImage, faceListId));
            Assert.Equal("No persistedFaceid found for this face", ex.Message);
        }
    }
}